import React, { Component } from "react";
import AuthForm from "./AuthForm";

function Register() {
  console.log("Register!!!!!");
  return (
    <>
      <AuthForm button="Зарегистрироваться" title="Регистрация" formId="auth">
        <input
          id="name-input"
          type="text"
          className="auth__input"
          autoComplete="off"
          placeholder="Email"
          name="name"
          minLength="2"
          maxLength="40"
          // value={inputNameValue}
          // onChange={(e) => handleNameChange(e)}
          required
        />
        <span id="name-input-error" className="popup__input-error"></span>
        <input
          id="about-input"
          type="text"
          className="auth__input"
          autoComplete="off"
          placeholder="Пароль"
          name="pass"
          // value={inputAboutValue}
          minLength="2"
          maxLength="200"
          required
          // onChange={handleAboutChange}
        />
        <span id="about-input-error" className="popup__input-error"></span>
      </AuthForm>
      <p className="">
        Уже зарегистрированы? <Link>Войти</Link>
      </p>
    </>
  );
}

export default Register;
